// @flow

import type { Page } from './devtools/page';
import type { Network } from './devtools/network';

import Chrome from './../chrome';

export type chromeDefaultConfig = {
  host: string;
  port: number;
  secure: boolean;
};

export type chromeOptionProperties = {
  host: string;
  port: number;
  secure: boolean;
  target: Function;
};

export type devToolsProtocolClient = {
  Protocol: Promise<{}>;
  List: Promise<{}>;
  New: Promise<{}>;
  Activate: Promise<{}>;
  Close: Promise<{}>;
  Version: Promise<{}>;

  /* domains */
  Page: Page;
  Network: Network;

  DOM: any;
  DOMDebugger: any;
  Debugger: any;
  Emulation: any;
  Input: any;
  Profiler: any;
  Runtime: any;
  Schema: any;

  close(): void;
}

export type chrome = {
  option: chromeOptionProperties;
  client: devToolsProtocolClient;

  /* methods */
  constructor(option?: Object): void;
  connectDevToolsProtocolClient(): Promise<Chrome>;
  fetchProtocol(): Promise<devToolsProtocolClient>;
  terminate(): Promise<Chrome>;
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/tot/Debugger/

export type SearchMatch = {
  lineNumber: Number,
  lineContent: String
};

// @flow

export type Rect = {
  x: Number,
  y: Number,
  width: Number,
  height: Number
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/tot/Network/

import type { FrameId, ResourceType } from './page';
import type { StackTrace } from './runtime';

export type LoaderId = string;
export type Headers = Object;
export type RequestId = String;
export type ConnectionType = "none" | "cellular2g" | "cellular3g" | "cellular4g" | "bluetooth" | "ethernet" | "wifi" | "wimax" | "other"
export type Timestamp = Number;

export type InterceptionId = String;
export type ErrorReason = "Failed" | "Aborted" | "TimedOut" | "AccessDenied" |
                   "ConnectionClosed" | "ConnectionReset" | "ConnectionRefused" |
                   "ConnectionAborted" | "ConnectionFailed" | "NameNotResolved" |
                   "InternetDisconnected" | "AddressUnreachable";

export type ResourcePriority = "VeryLow" | "Low" | "Medium" | "High" | "VeryHigh";
export type ReferrerPolicy = "unsafe-url" | "no-referrer-when-downgrade" | "no-referrer" | "origin" | "origin-when-cross-origin" | "no-referrer-when-downgrade-origin-when-cross-origin";
export type BlockedReason = "csp" | "mixed-content" | "origin" | "inspector" | "subresource-filter" | "other"


export type IntiatorType = "parser" | "script" | "other";
export type Initiator = {
  type: IntiatorType,
  stack?: StackTrace,
  url?: string,
  lineNumber?: Number
};

export type MixiedContentType = "blockable" | "optionally-blockable" | "none";
export type Request = {
  url: String,
  method: String,
  headers: Headers,
  postData?: String,
  mixedContentType?: MixiedContentType,
  initialPriority: ResourcePriority,
  referrerPolicy: ReferrerPolicy,
  isLinkPreload?: boolean,
};
export type Response = Object;

type CookieSameSite = "Strict" | "Lax"
export type Cookie = {
  name: String,
  value: String,
  domain: String,
  path: String,
  expires: Number,
  size: Number,
  httpOnly: boolean,
  secure: boolean,
  session: boolean,
  sameSite?: CookieSameSite
}

export type WebSocketRequest = {
  headers: Headers,
};

export type WebSocketResponse = {
  status: Number,
  statusText: String,
  headers: Headers,
  headersText?: String,
  requestHeaders?: Headers,
  requestHeadersText?: String,
};

export type WebSocketFrame = {
  opcode: Number,
  mask: boolean,
  payloadData: String,
};

export type Network = {
  /**
   * Enables network tracking, network events will now be delivered to the client.
   *
   * @param {Number} maxTotalBufferSize
   * @param {Number} maxResourceBufferSize
   */
  enable(
    maxTotalBufferSize?: Number,
    maxResourceBufferSize?: Number
  ): Promise<{}>;

  /**
   * Disables network tracking, prevents network events from being sent to the client.
   */
  disable(): Promise<{}>;

  /**
   * Allows overriding user agent with the given string.
   *
   * @param {String} userAgent
   */
  setUserAgentOverride(userAgent: String): Promise<{}>;

  /**
   * Specifies whether to always send extra HTTP headers with the requests from this page.
   *
   * @param {Object} headrs
   */
  setExtraHTTPHeaders(headers: Headers): Promise<{}>;

  /**
   * Returns content served for the given request.
   *
   * @return {Promise}
   */
  getResponseBody(requestId: RequestId): Promise<{
    body: String,
    base64Encoded: boolean
  }>;

  /**
   * Blocks URLs from loading.
   *
   * @return {Promise}
   */
  setBlockedURLs(): Promise<{urls: Array<String>}>;

  /**
   * This method sends a new XMLHttpRequest which is identical to the original one.
   * The following parameters should be identical:
   * method, url, async, request body, extra headers, withCredentials attribute, user, password.
   *
   * @param {String}
   * @return {Promise}
   */
  replayXHR(requestId: RequestId): Promise<>;

  /**
   * Tells whether clearing browser cache is supported.
   *
   * @return {Promise}
   */
  canClearBrowserCache(): Promise<{result: boolean}>;

  /**
   * Clears browser cache.
   *
   * @return {Promise}
   */
  clearBrowserCache(): Promise<{}>;

  /**
   * Tells whether clearing browser cookies is supported.
   *
   * @return {Promise}
   */
  canClearBrowserCookies(): Promise<{result: boolean}>;

  /**
   * Clears browser cookies.
   *
   * @return {Promise}
   */
  clearBrowserCookies(): Promise<>;

  /**
   * Returns all browser cookies for the current URL.
   * Depending on the backend support, will return detailed cookie information in the cookies field.
   *
   * @param {Array} urls? The list of URLs for which applicable cookies will be fetched
   * @return {Promise}
   */
  getCookies(urls?: Array<String>): Promise<{cookies: Array<Cookie>}>;

  /**
   * Returns all browser cookies. Depending on the backend support,
   * will return detailed cookie information in the cookies field. EXPERIMENTAL
   *
   * @type {Object}
   */
  getAllCookies(): Promise<{cookies: Array<Cookie>}>;

  /**
   * Deletes browser cookie with given name, domain and path.
   *
   * @param {String} cookieName
   * @param {String} url
   * @return {Promise}
   */
  deleteCookie(cookieName: String, url: String): Promise<>;

  /**
   * Sets a cookie with the given cookie data; may overwrite equivalent cookies if they exist.
   *
   * @param {String} url
   * @param {String} name
   * @param {String} value
   * @param {String} domain
   * @param {String} path
   * @param {boolean} secure
   * @param {boolean} httpOnly
   * @param {String} sameSite
   * @param {Number} Timestamp
   * @return {Promise}
   */
  setCookie(
    url: String,
    name: String,
    value: String,
    domain?: String,
    path?: String,
    secure?: boolean,
    httpOnly?: boolean,
    sameSite?: CookieSameSite,
    expirationDate?: Timestamp
  ): Promise<{success: boolean}>;

  /**
   * Tells whether emulation of network conditions is supported.
   *
   * @return {Promise}
   */
  canEmulateNetworkConditions(): Promise<{result: boolean}>;

  /**
   * Activates emulation of network conditions.
   *
   * @param {boolean} offline
   * @param {Number} latency
   * @param {Number} downloadThroughput
   * @param {Number} uploadThroughput
   * @param {String} ConnectionType
   * @return {Promise}
   */
  emulateNetworkConditions(
    offline: boolean,
    latency: Number,
    downloadThroughput: Number,
    uploadThroughput: Number,
    connectionType?: ConnectionType
  ): Promise<{}>;

  /**
   * Toggles ignoring cache for each request. If true, cache will not be used.
   *
   * @param {Boolean} cacheDisabled
   * @return {Promise}
   */
  setCacheDisabled(cacheDisabled: boolean): Promise<{}>;

  /**
   * Toggles ignoring of service worker for each request.
   *
   * @param {boolean} bypass
   */
  setBypassServiceWorker(bypass: boolean): Promise<{}>;

  /**
   * For testing.
   *
   * @param {Number} maxTotalSize
   * @param {Number} maxResourceSize
   */
  setDataSizeLimitsForTest(maxTotalSize: Number, maxResourceSize: Number): Promise<{}>;

  /**
   * Returns the DER-encoded certificate.
   *
   * @param {String}
   * @return {Promise}
   */
  getCertificate(origin: String): Promise<{ tableNames: Array<String> }>;

  /**
   * @param {boolean} boolean [
   *   Whether or not HTTP requests
   *   should be intercepted and Network.requestIntercepted events sent.
   *  ]
   */
  enableRequestInterception(enabled: boolean): Promise<>;

  /**
   * Response to Network.requestIntercepted
   * which either modifies the request
   * to continue with any modifications, or blocks it, or completes
   * it with the provided response bytes.
   * If a network fetch occurs as a result which encounters a redirect an additional
   * Network.requestIntercepted event will be sent with the same InterceptionId.
   *
   * @param {String} interceptionId
   * @param {String} errorReason?
   * @param {String} rawResponse?
   * @param {String} url?
   * @param {String} method?
   * @param {String} postData?
   * @param {Object} headers?
   * @return {Promise}
   */
  continueInterceptedRequest(
    interceptionId: InterceptionId,
    errorReason?: ErrorReason,
    rawResponse?: String,
    url?: String,
    method?: String,
    postData?: String,
    headers?: Headers
  ): Promise<>;


  /* Events */

  /**
   * Fired when resource loading priority is changed
   *
   * @param {Function} [callback(requestId, newPriority, timestamp)]
   */
  resourceChangedPriority(callback: (
    requestId: RequestId,
    newPriority: ResourcePriority,
    timestamp: Timestamp
  ) => void): void;

  /**
   * Fired when page is about to send HTTP request.
   *
   * @param {Function} [callback(
   *    requestId, frameId, loaderId,
   *    documentURL, request, timestamp,
   *    wallTime, initiator, redirectResponse?, type?
   * )]
   */
  requestWillBeSent(callback: (
    requestId: RequestId,
    frameId: FrameId,
    loaderId: LoaderId,
    documentURL: String,
    request: Request,
    timestamp: Timestamp,
    wallTime: Timestamp,
    initiator: Initiator,
    redirectResponse?: Response,
    type?: ResourceType
  ) => void): void;

  /**
   * Fired if request ended up loading from cache.
   *
   * @param {Function} [callback(requestId)]
   */
  requestServedFromCache(callback: (
    requestId: RequestId
  ) => void): void;

  /**
   * Fired when HTTP response is available.
   *
   * @param {Function} [callback(
   *   requestId, frameid, loaderId,
   *   timestamp, type, response
   * )]
   */
  responseReceived(callback: (
    requestId: RequestId,
    frameid: FrameId,
    loaderId: LoaderId,
    timestamp: Timestamp,
    type: ResourceType,
    response: Response
  ) => void): void;

  /**
   * Fired when data chunk was received over the network.
   *
   * @param {Function} [callback(
   *   requestId, timestamp, dataLength, encodedDataLength
   * )]
   */
  dataReceived(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    dataLength: Number,
    encodedDataLength: Number
  ) => void): void;

  /**
   * Fired when HTTP request has finished loading.
   *
   * @param {Function} [callback(
   *   requestId, timestamp, encodedDataLength
   * )]
   */
  loadingFinished(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    encodedDataLength: Number
  ) => void): void;

  /**
   * Fired when HTTP request has failed to load.
   *
   * @type {Function} [callback(
   *   requestid, timestamp, type,
   *   errorText, canceled?, blockedReason?
   * )]
   */
  loadingFailed(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    type: ResourceType,
    errorText: String,
    canceled?: boolean,
    blockedReason?: BlockedReason
  ) => void): void;

  /**
   * Fired when WebSocket is about to initiate handshake.
   *
   * @param {Function} [callback(
   *   requestId, timestamp, wallTime, request
   * )]
   */
  webSocketWillSendHandshakeRequest(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    wallTime: Timestamp,
    request: WebSocketRequest
  ) => void): void;

  /**
   * Fired when WebSocket handshake response becomes available.
   *
   * @param {Function} [callback(
   *   requestId, timestamp, response
   * )]
   */
  webSocketHandshakeResponseReceived(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    response: WebSocketResponse
  ) => void): void;

  /**
   * Fired upon WebSocket creation.
   *
   * @param {Function} [callback(
   *   requestId, url, initiator
   * )]
   */
  webSocketCreated(callback: (
    requestId: RequestId,
    url: String,
    initiator: Initiator
  ) => void): void;

  /**
   * Fired when WebSocket is closed.
   *
   * @param {Function} [callback(
   *   requestId, timestamp
   * )]
   */
  webSocketClosed(callback: (
    requestId: RequestId,
    timestamp: Timestamp
  ) => void): void;

  /**
   * Fired when WebSocket frame is received.
   *
   * @param {Function} [callback(
   *   requestId, timestamp, response
   * )]
   */
  webSocketFrameReceived(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    response: WebSocketFrame
  ) => void): void;

  /**
   * Fired when WebSocket frame error occurs.
   *
   * @type {Function} [callback(
   *  requestId, timestamp, errorMessage
   * )]
   */
  webSocketFrameError(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    errorMessage: String,
  ) => void): void;

  /**
   * Fired when WebSocket frame is sent.
   *
   * @type {Function} [callback(
   *  requestId, timestamp, response
   * )]
   */
  webSocketFrameSent(callback: (
    requestId: RequestId,
    timestamp: Timestamp,
    response: WebSocketFrame
  ) => void): void;

  /**
   * Details of an intercepted HTTP request,
   * which must be either allowed, blocked, modified or mocked.
   *
   * @param {Function} [callback(
   *  InterceptionId, request, resourceType,
   *  redirectHeaders?, redirectStatusCode?, redirectUrl?
   * )]
   */
  requestIntercepted(callback: (
    InterceptionId: InterceptionId,
    request: Request,
    resourceType: ResourceType,
    redirectHeaders?: Headers,
    redirectStatusCode?: Number,
    redirectUrl: String
  ) => void): void;
};

// @flow
// from: https://chromedevtools.github.io/devtools-protocol/tot/Page/

import type { LoaderId, Timestamp } from './network';
import type { SearchMatch } from './debugger';
import type { Rect } from './dom';
import type { StackTrace } from './runtime';

export type ResourceType = "Document" | "Stylesheet" | "Image" | "Media" |
                           "Font" | "Script" | "TextTrack" | "XHR" | "Fetch" |
                           "EventSource" | "WebSocket" | "Manifest" | "Other";
export type FrameId = String;
export type Frame = {
  id: string,
  parentId?: string,
  loaderId: LoaderId,
  name?: String,
  securityOrigin: String,
  mimeType: String,
};

export type FrameResource = {
  url: String,
  type: ResourceType,
  mimeType: String,
  lasModified?: Timestamp,
  contentSize?: Number,
  failed: Boolean,
  canceled: Boolean
};

export type FrameResourceTree = {
  frame: Frame,
  childFrames: Array<FrameResourceTree>,
  resources: Array<FrameResource>
}

export type TransitionType = "link" | "typed" | "auto_bookmark" | "auto_subframe" |
                      "manual_subframe" | "generated" | "auto_toplevel" |
                      "form_submit" | "reload" | "keyword" | "keyword_generated" | "other";

export type NavigationEntry = {
  id: Number,
  url: String,
  userTypedURL: String,
  title: String,
  transitionType: TransitionType
};

export type AppManifestError = {
  message: String,
  critical: Number,
  line: Number,
  column: Number,
};

export type NavigationResponse = "Proceed" | "Cancel" | "CancelAndIgnore";

export type LayoutViewport = {
  pageX: Number,
  pageY: Number,
  clientWidth: Number,
  clientHeight: Number
};

export type VisualViewport = {
  offsetX: Number,
  offsetY: Number,
  pageX: Number,
  pageY: Number,
  clientWidth: Number,
  clientHeight: Number,
  scale: Number,
};

export type ScreencastFrameMetadata = {
  offsetTop: Number,
  pageScaleFactor: Number,
  deviceWidth: Number,
  deviceHeight: Number,
  scrollOffsetX: Number,
  scrollOffsetY: Number,
  timestamp: Number
};

export type Page = {
  /**
   * Enables page domain notifications.
   */
  enable(): Promise<{}>;

  /**
   * Disables page domain notifications.
   */
  disable(): Promise<{}>;

  /**
   * Reloads given page optionally ignoring the cache.
   * @param {boolean} ignoreCache
   * @param {String} scriptToEvaluateOnLoad?
   * @return {Promise}
   */
  reload(ignoreCache?: Boolean, scriptToEvaluateOnLoad?: String): Promise<>;

  /**
   * Navigates current page to the given URL.
   * @param {String} url
   * @param {String} referrer?
   * @param {String} trasitionType?
   * @return {String}
   */
  navigate(
    url: String,
    referrer?: String,
    trasitionType?: TransitionType
  ): FrameId;

  /**
   * Force the page stop all navigations and pending resource fetches.
   */
  stopLoading(): Promise<>;

  /**
   * Returns navigation history for the current page. EXPERIMENTAL
   * @return {Promise}
   */
  getNavigationHistory(): Promise<{currentIndex: Number, entries: Array<NavigationEntry>}>;

  /**
   * Navigates current page to the given history entry.
   * @param {Number} entryId
   * @return {Promise}
   */
  navigateToHistoryEntry(entryId: Number): Promise<>;

  /**
   * Returns present frame / resource tree structure.
   * @return {Promise}
   */
  getResourceTree(): Promise<{ frameTree: FrameResourceTree }>;

  /**
   * Returns content of the given resource.
   *
   * @param {String} FrameId
   * @param {String} url
   * @return {Promise}
   */
  getResourceContent(frameId: FrameId, url: String): Promise<{
    content: String, base64Encoded: String
  }>;

  /**
   * Searches for given string in resource content.
   * @param {FrameId} frameId
   * @param {String} url
   * @param {String} query
   * @param {boolean} caseSensitive
   * @param {boolean} isRegex
   * @return {Promise}
   */
  searchInResource(
    frameId: FrameId,
    url: String,
    query: String,
    caseSensitive?: boolean,
    isRegex?: boolean
  ): Promise<{result: Array<SearchMatch>}>;

  /**
   * Sets given markup as the document's HTML.
   * @param {String} frameId
   * @param  {String} html
   * @return {Promise}
   */
  setDocumentContent(frameId: FrameId, html: String): Promise<>;

  /**
   * Capture page screenshot.
   * @param {String} jpeg or png only.
   * @param {Number} quality?
   * @param {booean} fromSurface? default to true
   * @return {Promise}
   */
  captureScreenshot(
    format?: "jpeg" | "png",
    quality?: Number,
    fromSurface?: boolean
  ): Promise<{data: String}>;

  /**
   * Print page as PDF.
   * @param {boolean} landscape
   * @param {boolean} displayHeaderFooter
   * @param {boolean} printBackground
   * @param {Number} scale
   * @param {Number} paperWidth
   * @param {Number} marginTop
   * @param {Number} marginBottom
   * @param {Number} marginLeft
   * @param {Number} marginRight
   * @param {String} pageRanges
   * @return {Promise} {data: String}
   */
  printToPDF(
    landscape?: boolean,
    displayHeaderFooter?: boolean,
    printBackground?: boolean,
    scale?: Number,
    paperWidth?: Number,
    paperHeight?: Number,
    marginTop?: Number,
    marginBottom?: Number,
    marginLeft?: Number,
    marginRight?: Number,
    pageRanges?: String
  ): Promise<{data: String}>;

  /**
   * Starts sending each frame using the screencastFrame event.
   * @param {String} jpeg or png only.
   * @param {Number} quality
   * @param {Number} maxWidth
   * @param {Number} maxHeight
   * @param {Number} everyNthFrame
   * @return {Promise}
   */
  startScreencast(
    format?: "jpeg" | "png",
    quality?: Number,
    maxWidth?: Number,
    maxHeight?: Number,
    everyNthFrame?: Number
  ): Promise<>;

  /**
   * Stops sending each frame in the screencastFrame
   * @return {Promise}
   */
  stopScreencast(): Promise<>;

  /**
   * Acknowledges that a screencast frame has been received by the frontend.
   * @param {Number} seccionId
   * @return {Promise}
   */
  screencastFrameAck(seccionId: Number): Promise<>;

  /**
   * Accepts or dismisses a JavaScript initiated dialog (alert, confirm, prompt, or onbeforeunload).
   * @param {boolean} accept
   * @param {String} promptText
   * @return {Promise}
   */
  handleJavaScriptDialog(accept: boolean, promptText?: String): Promise<>;

  /**
   * @return {Promise} { url: String, errors: Array<AppManifestError>, data?: String}
   */
  getAppManifest(): Promise<{ url: String, errors: Array<AppManifestError>, data?: String}>;

  /**
   */
  requestAppBanner(): Promise<>;

  /**
   * Toggles navigation throttling
   * which allows programatic control over navigation and redirect response.
   *
   * @param {boolean}
   * @return {Promise}
   */
  setControlNavigations(enable: boolean): Promise<>;

  /**
   * Should be sent in response to a navigationRequested or a redirectRequested event,
   * telling the browser how to handle the navigation.
   *
   * @param {Object} NavigationResponse
   * @param {Number} navigationId
   * @return {Promise}
   */
  processNavigation(response: NavigationResponse, navigationId: Number): Promise<>;

  /**
   * Returns metrics relating to the layouting of the page, such as viewport bounds/scale.
   * @return {Promise}
   */
  getLayoutMetrics(): Promise<{
    layoutViewport: LayoutViewport,
    visualViewport: VisualViewport,
    contentSize: Rect
  }>;

  /**
   * Creates an isolated world for the given frame
   *
   * @param {String} frameId
   * @param {String} worldName
   * @param {boolean} grantUniveralAccess
   * @return {Promise}
   */
  createIsolatedWorld(
    frameId: FrameId,
    worldName?: String,
    grantUniveralAccess: boolean
  ): Promise<>;

  /* -- events -- */

  /**
   * @param {Function}
   */
  domContentEventFired(
    callback: (timestamp: Timestamp) => void
  ): void;

  /**
   * @param {Function}
   */
  loadEventFired(
    callback: (timestamp: Timestamp) => void
  ): void;

  /**
   * Fired when frame has been attached to its parent.
   *
   * @param {Function}
   */
  frameAttached(callback: (
    frameId: FrameId,
    parentFrameId: FrameId,
    stack?: StackTrace
  ) => void): void;

  /**
   * Fired once navigation of the frame has completed.
   * Frame is now associated with the new loader.
   *
   * @param {Function}
   */
  frameNavigated(callback: (frame: Frame) => void): void;

  /**
   * Fired when frame has been detached from its parent.
   *
   * @param {Function}
   */
  frameDetached(callback: (frameId: FrameId) => void): void;

  /**
   * Fired when frame has started loading.
   *
   * @param {Function} frameId
   */
  frameStartedLoading(callback: (frameId: FrameId) => void): void;

  /**
   * Fired when frame has stopped loading.
   *
   * @param {Function} frameId
   */
  frameStoppedLoading(callback: (frameId: FrameId) => void): void;

  /**
   * Fired when frame schedules a potential navigation.
   *
   * @param {Function}
   */
  frameScheduledNavigation(callback: (frameId: FrameId, delay: Number) => void): void;

  /**
   * Fired when frame no longer has a scheduled navigation.
   *
   * @param {Function}
   */
  frameClearedScheduledNavigation(callback: (frameId: FrameId) => void): void;

  /**
   * @param {Function}
   */
  frameResized(callback: Function): void;

  /**
   * Fired when a JavaScript initiated dialog
   * (alert, confirm, prompt, or onbeforeunload) has been closed.
   *
   * @param {Function}
   */
  javascriptDialogClosed(callback: (result: boolean) => void): void;

  /**
   * Compressed image data requested by the startScreencast.
   *
   * @param {Function}
   */
  screencastFrame(
    callback: (
      data: String,
      metadata: ScreencastFrameMetadata,
      sessionId: Number
    ) => void
  ): void;

  /**
   * Fired when the page with currently enabled screencast was shown or hidden .
   *
   * @param {Function}
   */
  screencastVisibilityChanged(callback: (visible: boolean) => void): void;

  /**
   * Fired when interstitial page was shown
   *
   * @param {Function}
   */
  interstitialShown(callback: Function): void;

  /**
   * Fired when interstitial page was hidden
   *
   * @param {Function}
   */
  interstitialHidden(callback: Function): void;

  /**
   * Fired when a navigation is started if navigation throttles are enabled.
   * The navigation will be deferred until processNavigation is called.
   *
   * @param {Function}
   */
  navigationRequested(
    callback: (
      isInMainFrame: boolean,
      isRedirect: boolean,
      navigationId: Number,
      url: String
    ) => void
  ): void;
};

